import React from 'react';

export default function Navbar() {
    return (
      <nav className="navbar navbar-light bg-light">
        <a className="navbar-brand" href="/about">
          <img
            className="logo"
            src={logo}
            width="100"
            height="90"
            alt="Logo"
            loading="lazy"
          />
        </a>
      </nav>
    );
  }
